import React from 'react';
import { Link } from 'react-router-dom';
import { TopNavStyle } from "./style";


const TopNav = () => {
  return (
    <TopNavStyle>


            <Link to="/">  홈  </Link>
            <Link to="/jacket" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white" }}>  과잠  </Link>
            <Link to="/goods">  굿즈  </Link>
            <Link to="/menu1">  메뉴1  </Link>
            <Link to="/menu2">  메뉴2  </Link>


    </TopNavStyle>
  );
};

export default TopNav;
